import React from 'react'
import { useSelector } from 'react-redux';
import { useNavigate } from 'react-router-dom';

const CheckoutPayment = () => {
    const navigate = useNavigate();
    const state = useSelector((state) => state.controlItems);
    const dataShip = state.cart.shippingAddress;

    const allData = ((dataShip.fullName != null && dataShip.fullName !== '') && (dataShip.rut != null && dataShip.rut !== '') && (dataShip.addressPhone != null && dataShip.addressPhone !== '') && (dataShip.address != null && dataShip.address !== '') && (dataShip.address2 != null && dataShip.address2 !== '') && (dataShip.city != null && dataShip.city !== '') && (dataShip.region != null && dataShip.region !== '') && (dataShip.postalCode != null && dataShip.postalCode !== '') && (dataShip.additional != null && dataShip.additional !== ''))
    if (!allData) {
        console.log('falta info');
        navigate('/checkout/shipping');
    } else {
        console.log('no falta info');
    }

    const UserComplete = () => {

        return (
            <div className="container">
                <div className='col-md-7 col-lg-11 mx-auto'>
                    <h3 className='text-center'>
                        Datos personales
                    </h3>
                    <ul className="list-group mb-3">

                        <li className="list-group-item d-flex justify-content-between bg-light" >
                            <span >Nombre:</span>{dataShip.fullName}
                        </li>
                        <li className="list-group-item d-flex justify-content-between bg-light " >
                            <span >Rut: </span> {dataShip.rut}
                        </li>
                        <li className="list-group-item d-flex justify-content-between bg-light " >
                            <span >Teléfono: </span> {dataShip.addressPhone}
                        </li>
                        <li className="list-group-item d-flex justify-content-between bg-light " >
                            <span >Dirección: </span>dasdasdasdsadsasddsasda dsadsad s sddsa ds ds dsadsadsadsadsadsadsdsdsa {dataShip.address}, {dataShip.address2}
                        </li>
                    </ul>
                </div>
            </div>
        );
    };

    return (
        <div>
            <UserComplete />
        </div>
    )
}

export default CheckoutPayment
